MongoDB "no SNI name sent" error from heroku java application<p>I followed <a href="https://blog.dejavu.sk/running-jersey-2-applications-on-heroku/" rel="nofollow noreferrer">this tutorial</a> to deploy a sample application to Heroku. I just added the below method in <code>MyResource</code> class and returned the result from it instead of <code>"Hello World"</code> from <code>getIt()</code> method. I'm connecting to an atlas free tier cluster:</p>

<pre><code>static String getMessage() {
        MongoClient mongoClient = new MongoClient(new MongoClientURI("mongodb://&lt;USER&gt;:&lt;PASSWORD&gt;@cluster0-shard-00-00-2lbue.mongodb.net:27017,cluster0-shard-00-01-2lbue.mongodb.net:27017,cluster0-shard-00-02-2lbue.mongodb.net:27017/test?ssl=true&amp;replicaSet=Cluster0-shard-0&amp;authSource=admin"));
        DB database = mongoClient.getDB("mastery");
        DBCollection collection = database.getCollection("summary");

        DBObject query = new BasicDBObject("_id", new ObjectId("5c563fa2645d6b444c018dcb"));
        DBCursor cursor = collection.find(query);

        return (String)cursor.one().get("message");
    }
</code></pre>

<p>This is the driver I'm using:</p>

<pre><code>&lt;dependency&gt;
      &lt;groupId&gt;org.mongodb&lt;/groupId&gt;
      &lt;artifactId&gt;mongodb-driver&lt;/artifactId&gt;
      &lt;version&gt;3.9.1&lt;/version&gt;
&lt;/dependency&gt;
</code></pre>

<p>This is my import:</p>

<pre><code>import com.mongodb.*;
</code></pre>

<p>The application works fine from my local system. But I face the below error when I deploy the application to Heroku and hit the service:</p>

<pre><code>INFO: Exception in monitor thread while connecting to server cluster0-shard-00-01-2lbue.mongodb.net:27017
com.mongodb.MongoCommandException: Command failed with error 8000 (AtlasError): 'no SNI name sent, make sure using a MongoDB 3.4+ driver/shell.' on server cluster0-shard-00-01-2lbue.mongodb.net:27017. The full response is { "ok" : 0, "errmsg" : "no SNI name sent, make sure using a MongoDB 3.4+ driver/shell.", "code" : 8000, "codeName" : "AtlasError" }
at com.mongodb.internal.connection.ProtocolHelper.getCommandFailureException(ProtocolHelper.java:179)
at com.mongodb.internal.connection.InternalStreamConnection.receiveCommandMessageResponse(InternalStreamConnection.java:299)
at com.mongodb.internal.connection.InternalStreamConnection.sendAndReceive(InternalStreamConnection.java:255)
at com.mongodb.internal.connection.CommandHelper.sendAndReceive(CommandHelper.java:83)
at com.mongodb.internal.connection.CommandHelper.executeCommand(CommandHelper.java:33)
at com.mongodb.internal.connection.InternalStreamConnectionInitializer.initializeConnectionDescription(InternalStreamConnectionInitializer.java:106)
at com.mongodb.internal.connection.InternalStreamConnectionInitializer.initialize(InternalStreamConnectionInitializer.java:63)
at com.mongodb.internal.connection.InternalStreamConnection.open(InternalStreamConnection.java:127)
at com.mongodb.internal.connection.DefaultServerMonitor$ServerMonitorRunnable.run(DefaultServerMonitor.java:117)
at java.lang.Thread.run(Thread.java:748)
</code></pre>

<p>What is this SNI name? I can understand that the drivers are able to pick it from my machine, but not from Heroku machine. But I'm clueless on how to go about solving this! Is there a way to configure Heroku to reveal the SNI name when the driver asks for it? Can we get this value manually from somewhere in Heroku and directly feed it to the MongoDB drivers? Any help is appreciated.</p>

<p><strong>EDIT:</strong>
It <a href="https://en.wikipedia.org/wiki/Server_Name_Indication" rel="nofollow noreferrer">turned out</a> that the client mentions the SNI name of the server it wishes to connect to as part of TLS security. And there seems to be a way to manually <a href="https://github.com/twisted/txmongo/issues/236#issuecomment-416364522" rel="nofollow noreferrer">indicate the name in python driver</a>. Is there any way to do this from java? Still puzzled why this is not an issue when running the app locally.</p>

