JWT Token will not generate on Heroku<p>This is super weird. I have everything working when running my Node.js app on the local host. But after deploying to Heroku, it always gives me 400 Bad Request and a blank response body {} . I tested both environments with the same postman request only changing the base URL.</p>

<p>Here's my post method:</p>

<pre><code>app.post('/users', (req, res) =&gt; {
var body = _.pick(req.body, ['email', 'password', 'f_name', 'l_name', 'phone', 'address']);
var user = new User(body);

user.save().then(() =&gt; {
  return user.generateAuthToken();
}).then((token) =&gt; {
  res.header('x-auth', token).send(user);
}).catch((err) =&gt; {
  res.status(400).send(err);
});
});
</code></pre>

<p>Eventually, I saw that whenever I was trying to create a token when posting a new user, my localhost db does work, but no token was created in the Heroku environment.</p>

<p>Which means this function is the most suspicious of all:</p>

<pre><code>UserSchema.methods.generateAuthToken = function () {
var user = this;
var access = 'auth';
var token = jwt.sign({_id: user._id.toHexString(), access}, process.env.JWT_SECRET).toString();

user.tokens = user.tokens.concat([{access, token}]);

return user.save().then(() =&gt; {
    return token;
}).catch((err) =&gt; {
    return err;
});
};
</code></pre>

<p>What I don't understand is, why would this make any difference in the deployment environment? And how would I ever know what went wrong inside Heroku? When running locally we usually get those error logs, heroku logs doesn't do any good. And although I tried to catch an error and return them, nothing came back to my postman response body.</p>

<p>Thanks for any help!</p>

