How to configure spring-data-mongodb to use 2 different mongo instances sharing the same document model<p>I work for a company that has <strong>multiple brands</strong>, therefore we have a couple <strong>MongoDB instances</strong> on some <strong>different hosts</strong> holding the same document model for our Customer on each of these brands. (Same structure, not same data)</p>
<p>For the sake of simplicity let's say we have an <em>Orange</em> brand, with database instance serving on port <strong>27017</strong> and <em>Banana</em> brand with database instance serving on port <strong>27018</strong></p>
<p>Currently I'm developing a fraud detection service which is required to <strong>connect to all databases</strong> and analyze all the customers' behavior together regardless of the brand.</p>
<p>So my &quot;model&quot; has a <strong>shared</strong> entity for <strong>Customer</strong>, annotated with <strong>@Document</strong> (org.springframework.data.mongodb.core.mapping.Document)</p>
<p>Next thing I have is <strong>two MongoRepositories</strong> such as:</p>
<pre><code>public interface BananaRepository extends MongoRepository&lt;Customer, String&gt;

    List&lt;Customer&gt; findAllByEmail(String email);

public interface OrangeRepository extends MongoRepository&lt;Customer, String&gt;

    List&lt;Customer&gt; findAllByEmail(String email);

</code></pre>
<p>With some stub method for finding customers by Id, Email, and so on. Spring is responsible for generating all implementation classes for such interfaces (pretty standard spring stuff)</p>
<p>In order to hint each of these repositories to connect to the right mongodb instance, I need two Mongo Config such as:</p>
<pre><code>
@Configuration
@EnableMongoRepositories(basePackageClasses = {Customer.class})
public class BananaConfig extends AbstractMongoConfiguration {

    @Value(&quot;${database.mongodb.banana.username:}&quot;)
    private String username;
    @Value(&quot;${database.mongodb.banana.database}&quot;)
    private String database;
    @Value(&quot;${database.mongodb.banana.password:}&quot;)
    private String password;
    @Value(&quot;${database.mongodb.banana.uri}&quot;)
    private String mongoUri;


    @Override
    protected Collection&lt;String&gt; getMappingBasePackages() {
        return Collections.singletonList(&quot;com.acme.model&quot;);
    }

    @Override
    protected String getDatabaseName() {
        return this.database;
    }

    @Override
    @Bean(name=&quot;bananaClient&quot;)
    public MongoClient mongoClient() {
        final String authString;

        //todo: Use MongoCredential
        //todo: Use ServerAddress
        //(See https://docs.spring.io/spring-data/mongodb/docs/current/reference/html/#repositories) 10.3.4
        if ( valueIsPresent(username) ||valueIsPresent(password)) {
            authString = String.format(&quot;%s:%s@&quot;, username, password);
        } else {
            authString = &quot;&quot;;
        }
        String conecctionString = &quot;mongodb://&quot; + authString + mongoUri + &quot;/&quot; + database;

        System.out.println(&quot;Going to connect to: &quot; + conecctionString);

        return new MongoClient(new MongoClientURI(conecctionString, builder()
                .connectTimeout(5000)
                .socketTimeout(8000)
                .readPreference(ReadPreference.secondaryPreferred())
                .writeConcern(ACKNOWLEDGED)));

    }

    @Bean(name = &quot;bananaTemplate&quot;)
    public MongoTemplate mongoTemplate(@Qualifier(&quot;bananaFactory&quot;) MongoDbFactory mongoFactory) {
        return new MongoTemplate(mongoFactory);
    }

    @Bean(name = &quot;bananaFactory&quot;)
    public MongoDbFactory mongoFactory() {
        return new SimpleMongoDbFactory(mongoClient(),
                getDatabaseName());
    }



    private static int sizeOfValue(String value){
        if (value == null) return 0;
        return value.length();
    }
    private static boolean valueIsMissing(String value){
        return sizeOfValue(value) == 0;
    }
    private static boolean valueIsPresent(String value){
        return ! valueIsMissing(value);
    }
}
</code></pre>
<p>I <strong>also</strong> have similar config for <strong>Orange</strong> which points to the proper mongo instance.</p>
<p>Then I have my service like this:</p>
<pre><code>    public List&lt;? extends Customer&gt; findAllByEmail(String email) {
        return  Stream.concat(
                bananaRepository.findAllByEmail(email).stream(),
                orangeRepository.findAllByEmail(email).stream())
                .collect(Collectors.toList());

    }
</code></pre>
<p><em>Notice</em> that I'm calling <strong>both repositories</strong> and then collecting back the results into <strong>one single list</strong></p>
<p>What I would expect to happen is that <strong>each repository</strong> would connect to its <strong>corresponding mongo instance</strong> and query for the customer by its email.
But this <strong>don't happened</strong>. I always got the query executed against the same mongo instance.
But in the database log I can see both connections being made by spring.
It just uses one connection to run the queries for both repositories.</p>
<p>This is not surprising as both Mongo Config points to the <strong>same model package</strong> here. Right. But I also tried other approaches such as creating a <em>BananaCustomer extends Customer</em>, into its own <em>model.banana</em> package, and another <em>OrangeCustomer extends Customer</em> into its <em>model.orange</em> package, along with specifying the <strong>proper</strong> <em>basePackageClasses</em> into <strong>each config</strong>. But that <strong>neither worked</strong>, I've ended up getting both queries run against the <strong>same database</strong>.</p>
<blockquote>
<p>:(</p>
</blockquote>
<p>After scavenging official Spring-data-mongodb documentation for hours, and looking throughout thousands of lines of code here and there, I've run out of options: <strong>seems like nobody have done what I'm trying to accomplish before</strong>.
<em>Except</em> for this guy here that had to do the same thing but using JPA instead of mongodb: <a href="https://dzone.com/articles/multiple-databases-with-shared-entity-classes-in-s" rel="nofollow noreferrer">Link to article</a></p>
<p>Well, while it's still spring-data it't not for mongodb.</p>
<h2>So here is my question:</h2>
<p>How can I <strong>explicitly</strong> tell <strong>each repository</strong> to use a <strong>specific mongo config</strong>?</p>
<p><em>Magical autowiring rules, except when it doesn't work and nobody understands the magic</em>.</p>
<p>Thanks in advance.</p>

