Mongoose MVC - TypeError: ItemModel is not a constructor<p>I'm trying to follow MVC pattern by defining/exporting a model, and using this model in the controller. However, I'm getting an error: TypeError: ItemModel is not a constructor.</p>

<p>I've followed several other examples and am unable to see why this error is occurring.</p>

<p>The file structure is as follows:</p>

<p>src\db_test.js</p>

<p>src\controller\Item.js</p>

<p>src\models\Item.js</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-html lang-html prettyprint-override"><code>const mongoose = require('mongoose');

const ItemSchema = new mongoose.Schema({
    "name": String
});

